import React from 'react';
import logo from './logo.svg';
import { Header } from './components/Header/Header';
import { PetsCard } from './components/PetsCards/PetsCards';
import categories from './components/Data/PetsCategories'
import catIcon from "./images/cat20-128.webp"
import './App.css';

function App() {
  return (
    <div className="App">

     <Header>Choose a survey to get started</Header>
      <div className="flex flex-row flex-wrap justify-center mt-16">
          {categories && categories.map((element:any, i:any)=>
          <div key={i}>
            <PetsCard imgSrc={element.ImgSrc} imgAlt={element.ImgAlt} ></PetsCard>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
